/* eslint-disable @typescript-eslint/no-unused-vars */
import { Button } from '@patternfly/react-core'
import { createContext, ReactNode, useContext, useState } from 'react'

const TranslationContext = createContext(false)
const SetTranslationContext = createContext<(dev: boolean) => void>(() => {
    /**/
})

export function TranslationProvider(props: { children: ReactNode }) {
    const [theme, setTranslation] = useState(false)
    return (
        <TranslationContext.Provider value={theme}>
            <SetTranslationContext.Provider value={setTranslation}>{props.children}</SetTranslationContext.Provider>
        </TranslationContext.Provider>
    )
}

export function useTranslation() {
    const devMode = useContext(TranslationContext)
    if (devMode) {
        return {
            t: (text: string, options?: { count?: number }) => text.toUpperCase(),
        }
    }
    return {
        t: (text: string, options?: { count?: number }) => {
            if (options?.count !== undefined) {
                text = text.replace('{{count}}', options.count.toString())
            }
            return text
        },
    }
}

export function TranslationSwitcher() {
    const devMode = useContext(TranslationContext)
    const setDevMode = useContext(SetTranslationContext)
    const toggleTheme = () => setDevMode(!devMode)
    return (
        <Button onClick={toggleTheme} variant="plain">
            {devMode ? 'AA' : 'Aa'}
        </Button>
    )
}

import { ReactNode } from 'react'

export function Collapse(props: { open: boolean; children: ReactNode }) {
    let className = 'collapsed'
    if (props.open) className += ' expanded'
    return <div className={className}>{props.children}</div>
}

import { createContext, ReactNode, useContext, useState } from 'react'

export const DialogContext = createContext<[ReactNode | undefined, (dialog?: ReactNode) => void]>([undefined, () => null])

export function useDialog() {
    return useContext(DialogContext)
}

export function DialogProvider(props: { children?: ReactNode }) {
    const [dialog, setDialog] = useState<ReactNode>()
    return (
        <DialogContext.Provider value={[dialog, setDialog]}>
            {dialog !== undefined && dialog}
            {props.children}
        </DialogContext.Provider>
    )
}

import {
    Button,
    DataList,
    DataListCell,
    DataListCheck,
    DataListControl,
    DataListDragButton,
    DataListItem,
    DataListItemCells,
    DataListItemRow,
    Modal,
    ModalVariant,
} from '@patternfly/react-core'
import { FormEvent, useCallback, useEffect, useState } from 'react'
import { ITableColumn } from './PageTable'

export function useColumnModal<T extends object>(columns: ITableColumn<T>[]) {
    const [columnModalOpen, setColumnModalOpen] = useState(false)
    const openColumnModal = useCallback(() => {
        setColumnModalOpen(true)
    }, [])
    const [managedColumns, setManagedColumns] = useState<ITableColumn<T>[]>(() => columns)

    useEffect(() => {
        setManagedColumns((managedColumns) =>
            managedColumns.map((managedColumn) => columns.find((column) => column.header === managedColumn.header) ?? managedColumn)
        )
    }, [columns])

    const onClose = useCallback(() => {
        setColumnModalOpen(false)
    }, [])
    // const selectAllColumns = useCallback(() => {
    //     setManagedColumns((managedColumns) => {
    //         for (const column of managedColumns) {
    //             column.enabled = true
    //         }
    //         return [...managedColumns]
    //     })
    // }, [])
    const onDragFinish = useCallback((itemOrder: string[]) => {
        setManagedColumns((managedColumns) => {
            return itemOrder.map((header) => managedColumns.find((column) => column.header === header)) as ITableColumn<T>[]
        })
    }, [])
    const handleChange = useCallback((checked: boolean, event: FormEvent<HTMLInputElement>) => {
        const columnHeader = (event.target as unknown as { name?: string }).name
        if (columnHeader) {
            setManagedColumns((managedColumns) => {
                for (const column of managedColumns) {
                    if (column.header !== columnHeader) continue
                    column.enabled = checked
                }
                return [...managedColumns]
            })
        }
    }, [])
    const columnModal = (
        <Modal
            variant={ModalVariant.medium}
            title="Manage columns"
            // description={
            //     <TextContent>
            //         <Text component={TextVariants.p}>Selected categories will be displayed in the table.</Text>
            //         <Button isInline onClick={selectAllColumns} variant="link">
            //             Select all
            //         </Button>
            //     </TextContent>
            // }
            isOpen={columnModalOpen}
            onClose={onClose}
            actions={[
                <Button key="save" variant="primary" onClick={onClose}>
                    Close
                </Button>,
                // <Button key="cancel" variant="link" onClick={onClose}>
                //     Cancel
                // </Button>,
            ]}
        >
            <DataList
                aria-label="Table column management"
                id="table-column-management"
                isCompact
                onDragFinish={onDragFinish}
                itemOrder={managedColumns.map((column) => column.header)}
                gridBreakpoint="none"
                style={{ borderTopWidth: 'thin' }}
            >
                {managedColumns.map((column) => {
                    // if (index === 0) return <Fragment />
                    return (
                        <DataListItem
                            key={column.header}
                            id={column.header}
                            aria-labelledby="table-column-management-item1"
                            style={{ borderBottomWidth: 'thin' }}
                        >
                            <DataListItemRow>
                                <DataListControl>
                                    <DataListDragButton
                                        aria-label="Reorder"
                                        aria-labelledby="table-column-management-item1"
                                        aria-describedby="Press space or enter to begin dragging, and use the arrow keys to navigate up or down. Press enter to confirm the drag, or any other key to cancel the drag operation."
                                        aria-pressed="false"
                                    />
                                    <DataListCheck
                                        aria-labelledby="table-column-management-item1"
                                        checked={column.enabled !== false}
                                        name={column.header}
                                        id={column.header}
                                        onChange={handleChange}
                                        otherControls
                                    />
                                </DataListControl>
                                <DataListItemCells
                                    dataListCells={[
                                        <DataListCell id="table-column-management-item1" key={column.header}>
                                            <label htmlFor={column.header}>{column.header}</label>
                                        </DataListCell>,
                                    ]}
                                />
                            </DataListItemRow>
                        </DataListItem>
                    )
                })}
            </DataList>
        </Modal>
    )
    return { openColumnModal, columnModal, managedColumns }
}

import xl2Breakpoint from '@patternfly/react-tokens/dist/esm/global_breakpoint_2xl'
import lgBreakpoint from '@patternfly/react-tokens/dist/esm/global_breakpoint_lg'
import mdBreakpoint from '@patternfly/react-tokens/dist/esm/global_breakpoint_md'
import smBreakpoint from '@patternfly/react-tokens/dist/esm/global_breakpoint_sm'
import xlBreakpoint from '@patternfly/react-tokens/dist/esm/global_breakpoint_xl'
import xsBreakpoint from '@patternfly/react-tokens/dist/esm/global_breakpoint_xs'
import { useCallback, useEffect, useState } from 'react'

export enum WindowSize {
    xs,
    sm,
    'md',
    'lg',
    'xl',
    '2xl',
}

const breakpoints: Record<WindowSize, number> = {
    [WindowSize.xs]: Number(xsBreakpoint.value.replace('px', '')),
    [WindowSize.sm]: Number(smBreakpoint.value.replace('px', '')),
    [WindowSize.md]: Number(mdBreakpoint.value.replace('px', '')),
    [WindowSize.lg]: Number(lgBreakpoint.value.replace('px', '')),
    [WindowSize.xl]: Number(xlBreakpoint.value.replace('px', '')),
    [WindowSize['2xl']]: Number(xl2Breakpoint.value.replace('px', '')),
}

export function useWindowSize() {
    const [windowSize, setWindowSize] = useState<WindowSize>(WindowSize['2xl'])
    const handleResize = useCallback(() => {
        let size = WindowSize['2xl']
        for (; size >= WindowSize.sm; size--) {
            const breakpoint = breakpoints[size]
            if (window.innerWidth >= breakpoint) {
                break
            }
        }
        setWindowSize(size)
    }, [])

    useEffect(() => {
        const handler = handleResize
        window.addEventListener('resize', handler)
        return () => window.removeEventListener('resize', handler)
    }, [handleResize])

    useEffect(() => handleResize(), [handleResize])

    return windowSize
}

export function useWindowSizeOrLarger(size: WindowSize) {
    const windowSize = useWindowSize()
    return windowSize >= size
}

export function useWindowSizeOrSmaller(size: WindowSize) {
    const windowSize = useWindowSize()
    return windowSize <= size
}

import { Dropdown, DropdownItem, DropdownToggle, DropdownToggleCheckbox } from '@patternfly/react-core'
import { useCallback, useMemo, useState } from 'react'
import { useWindowSizeOrLarger, WindowSize } from './useBreakPoint'

export interface BulkSelectorProps<T> {
    itemCount?: number
    pageItems?: T[]
    selectedItems?: T[]
    selectItems?: (items: T[]) => void
    unselectAll?: () => void
    keyFn: (item: T) => string | number
}

export function BulkSelector<T extends object>(props: BulkSelectorProps<T>) {
    const [isOpen, setIsOpen] = useState(false)
    const isSmallOrLarger = useWindowSizeOrLarger(WindowSize.sm)

    const { pageItems, selectedItems, selectItems, unselectAll } = props

    const allPageItemsSelected =
        props.itemCount !== undefined &&
        props.itemCount > 0 &&
        pageItems &&
        pageItems.length > 0 &&
        (pageItems ?? []).every((item) => selectedItems?.includes(item))

    const onToggleCheckbox = useCallback(() => {
        if (allPageItemsSelected) {
            unselectAll?.()
        } else {
            selectItems?.(pageItems ?? [])
        }
    }, [allPageItemsSelected, unselectAll, selectItems, pageItems])

    const toggleText = useMemo(() => {
        if (isSmallOrLarger) {
            if (selectedItems && selectedItems.length > 0) {
                return `${selectedItems.length} selected`
            }
            return ''
        } else {
            if (selectedItems && selectedItems.length > 0) {
                return `${selectedItems.length}`
            }
            return ''
        }
    }, [isSmallOrLarger, selectedItems])

    const toggle = useMemo(() => {
        const selectedCount = selectedItems ? selectedItems.length : 0
        return (
            <DropdownToggle
                splitButtonItems={[
                    <DropdownToggleCheckbox
                        id="select-all"
                        key="select-all"
                        aria-label="Select all"
                        isChecked={allPageItemsSelected ? true : selectedCount > 0 ? null : false}
                        onChange={onToggleCheckbox}
                    >
                        {toggleText}
                    </DropdownToggleCheckbox>,
                ]}
                onToggle={(isOpen) => setIsOpen(isOpen)}
            />
        )
    }, [selectedItems, allPageItemsSelected, onToggleCheckbox, toggleText])

    const selectNoneDropdownItem = useMemo(() => {
        return (
            <DropdownItem
                id="select-none"
                key="select-none"
                onClick={() => {
                    unselectAll?.()
                    setIsOpen(false)
                }}
            >
                Select none
            </DropdownItem>
        )
    }, [unselectAll])

    const selectPageDropdownItem = useMemo(() => {
        return (
            <DropdownItem
                id="select-page"
                key="select-page"
                onClick={() => {
                    selectItems?.(pageItems ?? [])
                    setIsOpen(false)
                }}
            >
                {`Select ${pageItems?.length ?? 0} page items`}
            </DropdownItem>
        )
    }, [selectItems, pageItems])

    const dropdownItems = useMemo(() => [selectNoneDropdownItem, selectPageDropdownItem], [selectNoneDropdownItem, selectPageDropdownItem])

    return <Dropdown isOpen={isOpen} toggle={toggle} dropdownItems={dropdownItems} style={{ zIndex: 302 }} />
}

export enum PatternFlyColor {
    Green = 'green',
    Blue = 'blue',
    Red = 'red',
    Yellow = 'yellow',
    Grey = 'grey',
}

export function getPatternflyColor(color: PatternFlyColor) {
    switch (color) {
        case 'green':
            return 'var(--pf-global--success-color--100)'
        case 'red':
            return 'var(--pf-global--danger-color--100)'
        case 'yellow':
            return 'var(--pf-global--warning-color--100)'
        case 'blue':
            return 'var(--pf-global--info-color--100)'
    }
    return undefined
}

import { Children, cloneElement, isValidElement, ReactNode } from 'react'
import { getPatternflyColor, PatternFlyColor } from './patternfly-colors'

export function IconWrapper(props: { children: ReactNode; color?: PatternFlyColor; size?: 'sm' | 'md' | 'lg'; noPadding?: boolean }) {
    const newProps: {
        color?: string
        size?: string
    } = {}
    if (props.color) {
        newProps.color = getPatternflyColor(props.color)
    }
    let marginOffset: number | undefined = undefined
    let marginRight: number | undefined = undefined
    if (props.size) {
        newProps.size = props.size
        switch (props.size) {
            case 'sm':
                marginRight = 8
                break
            case 'md':
                marginOffset = -2
                marginRight = 12
                break
            case 'lg':
                marginOffset = -6
                marginRight = 16
                break
        }
    }
    if (props.noPadding) {
        marginRight = undefined
    }
    const newChildren = Children.toArray(props.children).map((child) => {
        if (isValidElement(child)) {
            const newChild = cloneElement(child, newProps)
            return newChild
        } else {
            return child
        }
    })
    return <div style={{ marginTop: marginOffset, marginBottom: marginOffset, marginRight }}>{newChildren}</div>
}

import { FormGroup, Select, SelectOptionObject } from '@patternfly/react-core'
import { CSSProperties, ReactNode, useCallback, useEffect, useState } from 'react'

export function SingleSelect(props: {
    id?: string
    label: string
    value: string
    onChange: (value: string) => void
    children: ReactNode
    style?: CSSProperties
    open?: boolean
    setOpen: (open: boolean) => void
}) {
    const { onChange } = props
    const [open, setOpenState] = useState(() => props.open)
    useEffect(() => {
        if (props.open !== undefined) {
            setOpenState(props.open)
        }
    }, [props.open, setOpenState])

    const setOpen = useCallback(
        (open: boolean) => {
            props.setOpen ? props.setOpen(open) : setOpenState(open)
        },
        [props]
    )

    const onToggle = useCallback(() => {
        setOpen(!open)
    }, [open, setOpen])

    const onSelect = useCallback(
        (_e, v: string | SelectOptionObject) => {
            if (typeof v === 'string') {
                onChange(v)
            } else {
                onChange(v.toString())
            }
            setOpen(false)
        },
        [onChange, setOpen]
    )

    const id = props.id ?? props.label.toLocaleLowerCase().split(' ').join('-')
    return (
        <FormGroup label={props.label} fieldId={id} style={props.style}>
            <Select id={id} selections={props.value} isOpen={open} onToggle={onToggle} onSelect={onSelect}>
                {props.children as React.ReactElement[]}
            </Select>
        </FormGroup>
    )
}

export function SingleSelect2(props: {
    id?: string
    children: ReactNode
    value?: string
    onChange: (value: string) => void
    label?: string
}) {
    const { id } = props
    const [open, setOpen] = useState(false)
    const onToggle = useCallback(() => {
        setOpen((open) => !open)
    }, [])
    const onSelect = useCallback(
        (_e, v) => {
            props.onChange(v)
            setOpen(false)
        },
        [props]
    )
    return (
        <Select id={id} selections={props.value} isOpen={open} onToggle={onToggle} onSelect={onSelect}>
            {props.children as any}
        </Select>
    )
}

import { Component, ErrorInfo, ReactNode } from 'react'

interface Props {
    children?: ReactNode
}

interface State {
    hasError: boolean
}

class ErrorBoundary extends Component<Props, State> {
    public state: State = {
        hasError: false,
    }

    public static getDerivedStateFromError(_: Error): State {
        // Update state so the next render will show the fallback UI.
        return { hasError: true }
    }

    public componentDidCatch(error: Error, errorInfo: ErrorInfo) {
        console.error('Uncaught error:', error, errorInfo)
    }

    public render() {
        if (this.state.hasError) {
            return <h1>Sorry.. there was an error</h1>
        }

        return this.props.children
    }
}

export default ErrorBoundary

import { Button, Form, Modal, ModalVariant, SelectOption } from '@patternfly/react-core'
import { createContext, ReactNode, useCallback, useContext, useEffect, useState } from 'react'
import { SingleSelect } from './components/SingleSelect'
import { useDialog } from './DialogContext'

export interface Settings {
    theme?: 'system' | 'light' | 'dark'
    tableLayout?: 'compact' | 'comfortable'
    formColumns?: 'single' | 'multiple'
    formLayout?: 'vertical' | 'horizontal'
    borders?: boolean
}

export const SettingsContext = createContext<[Settings, (settings: Settings) => void]>([{}, () => null])

export function useSettings() {
    const [settings] = useContext(SettingsContext)
    return settings
}

export function SettingsProvider(props: { children?: ReactNode }) {
    const [settings, setSettingsState] = useState<Settings>(() => {
        const settings: Settings = {
            theme: localStorage.getItem('theme') as 'system' | 'light' | 'dark',
            tableLayout: localStorage.getItem('tableLayout') as 'compact' | 'comfortable',
            formColumns: localStorage.getItem('formColumns') as 'single' | 'multiple',
            formLayout: localStorage.getItem('formLayout') as 'vertical' | 'horizontal',
            borders: localStorage.getItem('borders') !== 'false',
        }
        const activeTheme =
            settings.theme !== 'dark' && settings.theme !== 'light'
                ? window.matchMedia('(prefers-color-scheme: dark)').matches
                    ? 'dark'
                    : 'light'
                : settings.theme
        if (activeTheme === 'dark') {
            document.documentElement.classList.add('pf-theme-dark')
        } else {
            document.documentElement.classList.remove('pf-theme-dark')
        }
        return settings
    })

    const setSettings = useCallback((settings: Settings) => {
        localStorage.setItem('theme', settings.theme ?? 'system')
        localStorage.setItem('tableLayout', settings.tableLayout ?? 'comfortable')
        localStorage.setItem('formColumns', settings.formColumns ?? 'multiple')
        localStorage.setItem('formLayout', settings.formLayout ?? 'vertical')
        localStorage.setItem('borders', settings.borders ? 'true' : 'false')
        setSettingsState(settings)
        const activeTheme =
            settings.theme === 'system' ? (window.matchMedia('(prefers-color-scheme: dark)').matches ? 'dark' : 'light') : settings.theme
        if (activeTheme === 'dark') {
            document.documentElement.classList.add('pf-theme-dark')
        } else {
            document.documentElement.classList.remove('pf-theme-dark')
        }
    }, [])

    return <SettingsContext.Provider value={[settings, setSettings]}>{props.children}</SettingsContext.Provider>
}

export function useSettingsDialog() {
    const [open, setOpen] = useState(false)
    const openSetting = useCallback(() => setOpen(true), [])
    const [_, setDialog] = useDialog()
    useEffect(() => {
        if (open) {
            setDialog(<SettingsDialog open={open} setOpen={setOpen} />)
        } else {
            setDialog(undefined)
        }
    }, [open, setDialog])

    return openSetting
}

export function SettingsDialog(props: { open: boolean; setOpen: (open: boolean) => void }) {
    const onClose = () => props.setOpen(false)
    const [settings, setSettings] = useContext(SettingsContext)
    return (
        <Modal
            title="Settings"
            isOpen={props.open}
            onClose={onClose}
            variant={ModalVariant.medium}
            tabIndex={0}
            actions={[
                <Button key="close" variant="primary" onClick={onClose}>
                    Close
                </Button>,
            ]}
        >
            <Form isHorizontal={settings.formLayout === 'horizontal'}>
                <SingleSelect
                    label="Theme"
                    value={settings.theme ?? 'system'}
                    onChange={(theme) => setSettings({ ...settings, theme: theme as 'system' | 'light' | 'dark' })}
                >
                    <SelectOption value="system">System default</SelectOption>
                    <SelectOption value="light">Light</SelectOption>
                    <SelectOption value="dark">Dark</SelectOption>
                </SingleSelect>
                <SingleSelect
                    label="Table Layout"
                    value={settings.tableLayout ?? 'comfortable'}
                    onChange={(tableLayout) => setSettings({ ...settings, tableLayout: tableLayout as 'compact' | 'comfortable' })}
                >
                    <SelectOption value="comfortable">Comfortable</SelectOption>
                    <SelectOption value="compact">Compact</SelectOption>
                </SingleSelect>
                <SingleSelect
                    label="Form Columns"
                    value={settings.formColumns ?? 'multiple'}
                    onChange={(formColumns) => setSettings({ ...settings, formColumns: formColumns as 'multiple' | 'single' })}
                >
                    <SelectOption value="multiple">Multiple columns</SelectOption>
                    <SelectOption value="single">Single column</SelectOption>
                </SingleSelect>
                <SingleSelect
                    label="Form Layout"
                    value={settings.formLayout ?? 'vertical'}
                    onChange={(formLayout) => setSettings({ ...settings, formLayout: formLayout as 'vertical' | 'horizontal' })}
                >
                    <SelectOption value="vertical">Vertical labels</SelectOption>
                    <SelectOption value="horizontal">Horizontal labels</SelectOption>
                </SingleSelect>
                <SingleSelect
                    label="Borders"
                    value={settings.borders ? 'true' : 'false'}
                    onChange={(value) => setSettings({ ...settings, borders: value === 'true' })}
                    style={{ paddingBottom: 120 }}
                >
                    <SelectOption value="true">Yes</SelectOption>
                    <SelectOption value="false">No</SelectOption>
                </SingleSelect>
            </Form>
        </Modal>
    )
}

import { ReactNode } from 'react'
import { useWindowSizeOrLarger, WindowSize } from '.'
import ErrorBoundary from './components/ErrorBoundary'
import { useSettings } from './Settings'

export function PageBody(props: { children: ReactNode }) {
    const lg = useWindowSizeOrLarger(WindowSize.xl)
    const settings = useSettings()
    return (
        <ErrorBoundary>
            <div
                style={{
                    display: 'flex',
                    flexDirection: 'column',
                    height: '100%',
                    maxHeight: '100%',
                    overflow: 'hidden',
                    backgroundColor: 'var(--pf-c-page__main-section--BackgroundColor)',
                }}
            >
                <div
                    style={{
                        display: 'flex',
                        flexDirection: 'column',
                        height: '100%',
                        maxHeight: '100%',
                        margin: lg ? 24 : 0,
                        overflow: 'hidden',
                        border: settings.borders && lg ? 'thin solid var(--pf-global--BorderColor--100)' : undefined,
                        backgroundColor: 'var(--pf-global--BackgroundColor--100)',
                    }}
                >
                    {props.children}
                </div>
            </div>
        </ErrorBoundary>
    )
}

import {
    Breadcrumb,
    BreadcrumbItem,
    Button,
    Flex,
    FlexItem,
    PageSection,
    PageSectionVariants,
    Popover,
    Skeleton,
    Text,
    Title,
    Truncate,
} from '@patternfly/react-core'
import { OutlinedQuestionCircleIcon } from '@patternfly/react-icons'
import { CSSProperties, Fragment, ReactNode } from 'react'
import { useHistory } from 'react-router-dom'
import { useWindowSizeOrLarger, WindowSize } from './components/useBreakPoint'
import { useSettings } from './Settings'

export interface ICatalogBreadcrumb {
    id?: string
    label?: string
    to?: string
    target?: string
    component?: React.ElementType
}

function Breadcrumbs(props: { breadcrumbs: ICatalogBreadcrumb[]; style?: CSSProperties }) {
    const history = useHistory()
    if (!props.breadcrumbs) return <Fragment />
    return (
        <Breadcrumb style={props.style}>
            {props.breadcrumbs.map((breadcrumb) => {
                if (!breadcrumb.label) return <></>
                return (
                    <BreadcrumbItem
                        id={breadcrumb.id}
                        key={breadcrumb.id ?? breadcrumb.label}
                        component={breadcrumb.component}
                        onClick={breadcrumb.to ? () => breadcrumb.to && history.push(breadcrumb.to) : undefined}
                        style={{
                            color: breadcrumb.to ? 'var(--pf-c-breadcrumb__link--Color)' : undefined,
                            cursor: breadcrumb.to ? 'pointer' : undefined,
                        }}
                        isActive={breadcrumb.to === undefined}
                    >
                        {breadcrumb.label}
                    </BreadcrumbItem>
                )
            })}
        </Breadcrumb>
    )
}

export interface PageHeaderProps {
    breadcrumbs?: ICatalogBreadcrumb[]
    title?: string
    titleHelpTitle?: string
    titleHelp?: ReactNode
    description?: string
    controls?: ReactNode
    headerActions?: ReactNode
}

/**
 * PageHeader enables the responsive layout of the header.
 *
 * @param {Breadcrumb[]} breadcrumbs - The breadcrumbs for the page.
 * @param {string} title - The title of the page.
 * @param {string} titleHelpTitle - The title of help popover.
 * @param {ReactNode} titleHelp - The content for the help popover.
 * @param {string} description - The description of the page.
 * @param {ReactNode} controls - Support for extra page controls.
 * @param {ReactNode} headerActions - The actions for the page.
 *
 * @example
 * <Page>
 *   <PageLayout>
 *     <PageHeader
 *       breadcrumbs={[{ label: 'Home', to: '/home' }, { label: 'Page title' }]}
 *       title='Page title'
 *       description='Page description'
 *       headerActions={<PageActions actions={actions} />}
 *     />
 *     <PageBody />...</PageBody>
 *   </PageLayout>
 * <Page>
 */
export function PageHeader(props: PageHeaderProps) {
    const { breadcrumbs, title, description, controls, headerActions: pageActions } = props
    const xl = useWindowSizeOrLarger(WindowSize.xl)
    const isSmOrLarger = useWindowSizeOrLarger(WindowSize.sm)
    const settings = useSettings()
    return (
        <PageSection
            variant={PageSectionVariants.light}
            style={{
                paddingTop: breadcrumbs ? (xl ? 16 : 12) : xl ? 24 : 16,
                paddingBottom: xl ? 24 : 16,
                borderBottom: settings.borders ? 'thin solid var(--pf-global--BorderColor--100)' : undefined,
            }}
        >
            <Flex flexWrap={{ default: 'nowrap' }} alignItems={{ default: 'alignItemsStretch' }}>
                <FlexItem grow={{ default: 'grow' }}>
                    {breadcrumbs && <Breadcrumbs breadcrumbs={breadcrumbs} style={{ paddingBottom: xl ? 12 : 8 }} />}
                    <Fragment>
                        {title ? (
                            props.titleHelp ? (
                                <Popover headerContent={props.titleHelpTitle} bodyContent={props.titleHelp} position="bottom-start">
                                    <Title headingLevel="h1">
                                        {title}
                                        <Button variant="link" style={{ padding: 0, marginLeft: '8px', verticalAlign: 'top' }}>
                                            <OutlinedQuestionCircleIcon />
                                        </Button>
                                    </Title>
                                </Popover>
                            ) : (
                                <Title headingLevel="h1">{title}</Title>
                            )
                        ) : (
                            <Title headingLevel="h1">
                                <Skeleton width="160px" />
                            </Title>
                        )}
                        {isSmOrLarger && description && (
                            <Text component="p" style={{ paddingTop: xl ? 4 : 2 }}>
                                <Truncate content={description} />
                            </Text>
                        )}
                    </Fragment>
                </FlexItem>
                {title && (pageActions || controls) && (
                    <Flex direction={{ default: 'column' }} spaceItems={{ default: 'spaceItemsSm', xl: 'spaceItemsMd' }}>
                        <FlexItem grow={{ default: 'grow' }}>{controls}</FlexItem>
                        {pageActions && <FlexItem>{pageActions}</FlexItem>}
                    </Flex>
                )}
            </Flex>
        </PageSection>
    )
}

