    confirm: string
    cancel: string
    error: string
    close: string
    success: string
    isDanger?: boolean
    items: T[]
    columns: ITableColumn<T>[]
    errorColumns: ITableColumn<T>[]
    keyFn: (item: T) => string | number
    action: (item: T) => Promise<void>
    onClose?: (items: T[]) => void
}) {
    const [_, setDialog] = useDialog()
    const [isSubmitting, setSubmitting] = useState(false)
    const [isSubmited, setSubmited] = useState(false)
    const [progress, setProgress] = useState(0)

    const [error, setError] = useState('')
    const [statuses, setStatuses] = useState<Record<string | number, string | null | undefined>>()
    const onClose = useCallback(() => {
        props.onClose?.(props.items.filter((item) => statuses?.[props.keyFn(item)] === null))
        setDialog()
    }, [props, setDialog, statuses])

    const onConfirm = () => {
        async function handleConfirm() {
            const limit = pLimit(5)
            setSubmitting(true)
            let progress = 0
            await Promise.all(
                props.items.map((item: T) =>
                    limit(async () => {
                        const key = props.keyFn(item)
                        try {
                            await props.action(item)
                            setStatuses((statuses) => ({ ...(statuses ?? {}), [key]: null }))
                        } catch (err) {
                            if (err instanceof Error) {
                                const message = err.message
                                setStatuses((statuses) => ({ ...(statuses ?? {}), [key]: message }))
                            } else {
                                setStatuses((statuses) => ({ ...(statuses ?? {}), [key]: `Unknown error` }))
                            }
                            setError(props.error)
                        } finally {
                            setProgress(++progress)
                        }
                    })
                )
            )
            setSubmitting(false)
            setSubmited(true)
        }
        void handleConfirm()
    }

    const { paged, page, perPage, setPage, setPerPage } = usePaged(props.items)
    const [confirmed, setConfirmed] = useState(!props.confirm)

    return (
        <Modal
            titleIconVariant={props.isDanger ? 'warning' : undefined}
            title={props.title}
            variant={ModalVariant.medium}
            isOpen
            onClose={onClose}
            actions={
                !isSubmited
                    ? [
                          <Button
                              key="submit"
                              variant={props.isDanger ? 'danger' : 'primary'}
                              onClick={onConfirm}
                              isDisabled={!confirmed || isSubmitting || isSubmited}
                              isLoading={isSubmitting}
                          >
                              {isSubmitting ? props.submitting : props.submit}
                          </Button>,
                          <Button key="cancel" variant="link" onClick={onClose}>
                              {props.cancel}
                          </Button>,
                      ]
                    : [
                          <Button key="close" variant="secondary" onClick={onClose}>
                              {props.close}
                          </Button>,
                      ]
            }
            description={<Collapse open={!isSubmitting && !isSubmited}>{props.prompt}</Collapse>}
        >
            <Collapse open={isSubmitting || isSubmited}>
                <Progress
                    value={(progress / props.items.length) * 100}
                    title={error ? props.error : progress === props.items.length ? props.success : props.submittingTitle}
                    size={ProgressSize.lg}
                    variant={error ? ProgressVariant.danger : progress === props.items.length ? ProgressVariant.success : undefined}
                    style={{ marginBottom: 16 }}
                    measureLocation={error && progress === props.items.length ? ProgressMeasureLocation.none : undefined}
                />
            </Collapse>
            <div
                style={{
                    display: 'flex',
                    flexDirection: 'column',
                    maxHeight: 480,
                    overflow: 'hidden',
                }}
            >
                {!isSubmitting && !isSubmited ? (
                    <PageTable<T>
                        key="items"
                        pageItems={paged}
                        itemCount={props.items.length}
                        tableColumns={props.columns}
                        keyFn={props.keyFn}
                        page={page}
                        perPage={perPage}
                        setPage={setPage}
                        setPerPage={setPerPage}
                        compact
                        autoHidePagination
                        errorStateTitle="Error"
                        emptyStateTitle="No items"
                    />
                ) : (
                    <PageTable<T>
                        key="status"
                        pageItems={[...paged]}
                        itemCount={props.items.length}
                        tableColumns={[
                            ...props.errorColumns,
                            {
                                header: 'Status',
                                cell: (item) => {
                                    const key = props.keyFn(item)
                                    const status = statuses?.[key]
                                    if (status === undefined) {
                                        return (
                                            <span style={{ color: 'var(--pf-global--info-color--100)' }}>
                                                {<PendingIcon />}&nbsp; Pending {JSON.stringify(status)}
                                            </span>
                                        )
                                    }
                                    if (status === null) {
                                        return (
                                            <span style={{ color: 'var(--pf-global--success-color--100)' }}>
                                                {<CheckCircleIcon />}&nbsp; Success
                                            </span>
                                        )
                                    }
                                    return (
                                        <span style={{ color: 'var(--pf-global--danger-color--100)' }}>
                                            {<ExclamationCircleIcon />}&nbsp; {statuses?.[key]}
                                        </span>
                                    )
                                },
                            },
                        ]}
                        keyFn={props.keyFn}
                        page={page}
                        perPage={perPage}
                        setPage={setPage}
                        setPerPage={setPerPage}
                        compact
                        autoHidePagination
                        errorStateTitle="Error"
                        emptyStateTitle="No items"
                    />
                )}
            </div>
            {props.confirm && (
                <Collapse open={!isSubmitting && !isSubmited}>
                    <div style={{ marginLeft: 16, marginTop: 32, marginBottom: 8 }}>
                        <Checkbox id="confirm" label={props.confirm} isChecked={confirmed} onChange={setConfirmed} />
                    </div>
                </Collapse>
            )}
        </Modal>
    )
}

import useResizeObserver from '@react-hook/resize-observer'
import { ReactNode, useCallback, useLayoutEffect, useRef, useState } from 'react'
import { useWindowSizeOrSmaller, WindowSize } from './useBreakPoint'

export function Grid(props: { size?: number; maxColumns?: number; children?: ReactNode }) {
    const size = props.size ?? 350
    const target = useRef<HTMLDivElement>(null)
    const [gridTemplateColumns, setGridTemplateColumns] = useState('1fr')
    const resize = useCallback(
        (width: number) => {
            let columns = Math.min(props.maxColumns ?? 12, Math.max(Math.floor(width / size), 1))
            if (columns < 1) columns = 1
            setGridTemplateColumns(() => new Array(columns).fill('1fr').join(' '))
        },
        [props.maxColumns, size]
    )
    useResizeObserver(target, (entry) => resize(entry.contentRect.width))
    useLayoutEffect(() => {
        resize(target.current?.clientWidth ?? 0)
    }, [resize])
    const isMd = useWindowSizeOrSmaller(WindowSize.lg)
    const isXS = useWindowSizeOrSmaller(WindowSize.xs)
    let gap = 24
    if (isMd) gap = 16
    if (isXS) gap = 8
    return (
        <div ref={target} style={{ display: 'grid', gridAutoRows: '1fr', gridTemplateColumns, gap }}>
            {props.children}
        </div>
    )
}

import useResizeObserver from '@react-hook/resize-observer'
import { CSSProperties, ReactNode, useCallback, useEffect, useRef, useState } from 'react'

export function Scrollable(props: { children?: ReactNode; borderTop?: boolean; borderBottom?: boolean; style?: CSSProperties }) {
    const divEl = useRef<HTMLDivElement>(null)
    const [topShadow, setTopShadow] = useState(0)
    const [bottomShadow, setBottomShadow] = useState(0)
    const update = useCallback(() => {
        /* istanbul ignore else */
        if (divEl.current) {
            setTopShadow(Math.min(1, divEl.current.scrollTop / 8))
            const scrollBottom = divEl.current.scrollHeight - divEl.current.scrollTop - divEl.current.clientHeight - 1
            setBottomShadow(Math.max(0, Math.min(1, scrollBottom / 8)))
        }
    }, [])
    useEffect(() => update(), [update, props.children])
    useResizeObserver(divEl, () => {
        update()
    })
    const shadowOpacityTop = 0.2 * topShadow
    const shadowOpacityBottom = 0.2 * bottomShadow
    // const [theme] = useTheme()
    // if (theme === ThemeE.Dark) {
    //     shadowOpacityTop *= 6
    //     shadowOpacityBottom *= 6
    // }

    /* istanbul ignore next */
    const borderTop = props.borderTop ? 'thin solid rgba(0, 0, 0, 0.12)' : ''

    /* istanbul ignore next */
    const borderBottom = props.borderBottom ? 'thin solid rgba(0, 0, 0, 0.12)' : ''

    return (
        <div style={{ ...props.style, display: 'flex', flexDirection: 'column', flexGrow: 1, overflowY: 'hidden', position: 'relative' }}>
            <div
                ref={divEl}
                style={{ display: 'flex', flexDirection: 'column', flexGrow: 1, overflowY: 'auto', borderTop, borderBottom }}
                onScroll={update}
            >
                {props.children}
            </div>
            {
                /* istanbul ignore next */ shadowOpacityTop > 0 && (
                    <div
                        style={{
                            position: 'absolute',
                            top: 0,
                            height: '10px',
                            width: '100%',
                            background: `linear-gradient(rgba(0,0,0,${shadowOpacityTop}), rgba(0,0,0,0))`,
                        }}
                    />
                )
            }
            {
                /* istanbul ignore next */ shadowOpacityBottom > 0 && (
                    <div
                        style={{
                            position: 'absolute',
                            bottom: 0,
                            height: '10px',
                            width: '100%',
                            background: `linear-gradient(rgba(0,0,0,0), rgba(0,0,0,${shadowOpacityBottom}))`,
                        }}
                    />
                )
            }
        </div>
    )
}

