import { Dispatch, SetStateAction, useCallback, useState } from 'react'

export interface IPagedView {
    page: number
    perPage: number
    sort: string
    sortDirection: 'asc' | 'desc'
    filters: Record<string, string[]>
    setFilters: Dispatch<SetStateAction<Record<string, string[]>>>
}

export function usePagedView(view?: Partial<IPagedView>) {
    const [page, setPage] = useState(() => view?.page ?? 1)
    const [perPage, setPerPage] = useState(() => view?.perPage ?? 10)
    const [sort, setSort] = useState(() => view?.sort ?? '')
    const [sortDirection, setSortDirection] = useState<'asc' | 'desc'>(() => view?.sortDirection ?? 'asc')
    const [filters, setFilters] = useState<Record<string, string[]>>(() => view?.filters ?? {})
    const clearAllFilters = useCallback(() => setFilters({}), [setFilters])
    return { page, setPage, perPage, setPerPage, sort, setSort, sortDirection, setSortDirection, filters, setFilters, clearAllFilters }
}

import { HTTPError } from 'ky'
import { useRef } from 'react'
import useSWR from 'swr'
import { ITableColumn, IToolbarFilter } from '../../framework'
import { useSelected } from '../../framework/useTableItems'
import { usePagedView } from '../common/useView'
import { ItemsResponse, useFetcher } from '../Data'

export function useControllerView<T extends object>(
    url: string,
    getItemKey: (item: T) => string | number,
    toolbarFilters?: IToolbarFilter[],
    tableColumns?: ITableColumn<T>[]
) {
    const view = usePagedView({ sort: tableColumns && tableColumns.length ? tableColumns[0].sort : undefined })
    const itemCountRef = useRef<{ itemCount: number | undefined }>({ itemCount: undefined })

    const { page, perPage, sort, sortDirection, filters } = view

    let queryString = ''

    if (filters) {
        for (const key in filters) {
            const toolbarFilter = toolbarFilters?.find((filter) => filter.key === key)
            if (toolbarFilter) {
                const values = filters[key]
                if (values.length > 0) {
                    queryString ? (queryString += '&') : (queryString += '?')
                    if (values.length > 1) {
                        queryString += values.map((value) => `or__${toolbarFilter.query}=${value}`).join('&')
                    } else {
                        queryString += `${toolbarFilter.query}=${values.join(',')}`
                    }
                }
            }
        }
    }

    if (sort) {
        queryString ? (queryString += '&') : (queryString += '?')
        if (sortDirection === 'desc') {
            queryString += `order_by=-${sort}`
        } else {
            queryString += `order_by=${sort}`
        }
    }

    queryString ? (queryString += '&') : (queryString += '?')
    queryString += `page=${page}`

    queryString ? (queryString += '&') : (queryString += '?')
    queryString += `page_size=${perPage}`

    url += queryString
    const fetcher = useFetcher()
    const response = useSWR<ItemsResponse<T>>(url, fetcher)
    const { data, mutate } = response
    const refresh = () => mutate()

    useSWR<ItemsResponse<T>>(data?.next, fetcher)

    // eslint-disable-next-line @typescript-eslint/no-unsafe-assignment
    let error: Error | undefined = response.error
    if (error instanceof HTTPError) {
        if (error.response.status === 404 && view.page > 1) {
            view.setPage(1)
            error = undefined
        }
    }

    const selection = useSelected(data?.results ?? [], getItemKey)

    if (data?.count !== undefined) {
        itemCountRef.current.itemCount = data?.count
    }

    return {
        refresh,
        itemCount: itemCountRef.current.itemCount,
        pageItems: data ? data.results : undefined,
        error,
        ...view,
        ...selection,
    }
}

