export function FormSchema(props: { schema: JSONSchema6; base?: string }) {
    const { schema } = props
    const base = props.base ? props.base + '.' : ''

    const p: ReactNode[] = []

    for (const propertyName in schema.properties) {
        const property = schema.properties[propertyName]

        switch (property) {
            case true:
            case false:
                continue
        }

        const title = typeof property.title === 'string' ? property.title : propertyName

        let placeholder: string | undefined = (property as { placeholder?: string }).placeholder
        placeholder = typeof placeholder === 'string' ? placeholder : undefined

        const required = Array.isArray(schema.required) && schema.required.includes(propertyName)

        switch (property.type) {
            case 'string': {
                if ((property as { variant?: string }).variant === 'select') {
                    p.push(
                        <FormTextSelect
                            key={base + propertyName}
                            name={base + propertyName}
                            label={title}
                            placeholder={placeholder}
                            required={required}
                        />
                    )
                } else if ((property as { variant?: string }).variant === 'textarea') {
                    p.push(
                        <FormTextArea
                            key={base + propertyName}
                            name={base + propertyName}
                            label={title}
                            placeholder={placeholder}
                            required={required}
                        />
                    )
                } else if ((property as { variant?: string }).variant === 'password') {
                    p.push(
                        <FormTextInput
                            key={base + propertyName}
                            name={base + propertyName}
                            label={title}
                            placeholder={placeholder}
                            required={required}
                            secret
                        />
                    )
                } else {
                    p.push(
                        <FormTextInput
                            key={base + propertyName}
                            name={base + propertyName}
                            label={title}
                            placeholder={placeholder}
                            required={required}
                        />
                    )
                }
                break
            }
            case 'object':
                p.push(<FormSchema key={propertyName} schema={property} base={base + propertyName} />)
                break
        }
    }

    return <>{p}</>
}

import * as Ajv from 'ajv'

export function PageForm<T extends object>(props: {
    schema?: JSONSchema6
    children?: ReactNode
    submitText: string
    onSubmit: FormPageSubmitHandler<T>
    cancelText: string
    onCancel?: () => void
    defaultValue?: DeepPartial<T>
    isVertical?: boolean
}) {
    const { schema, defaultValue } = props
    const form = useForm<T>({
        defaultValues: defaultValue ?? ({} as DeepPartial<T>),
        resolver: schema ? ajvResolver(schema as Ajv.JSONSchemaType<T>, { strict: false } as Ajv.Options) : undefined,
    })

    const { handleSubmit, setError: setFieldError } = form
    const [error, setError] = useState('')
    const isSm = useWindowSizeOrLarger(WindowSize.md)
    const [settings] = useContext(SettingsContext)
    const horizontalLabels = props.isVertical ? false : settings.formLayout === 'horizontal'
    const multipleColumns = settings.formColumns === 'multiple'

    const sm: gridItemSpanValueShape | undefined = multipleColumns ? (horizontalLabels ? 12 : 12) : 12
    const md: gridItemSpanValueShape | undefined = multipleColumns ? (horizontalLabels ? 12 : 6) : 12
    const lg: gridItemSpanValueShape | undefined = multipleColumns ? (horizontalLabels ? 6 : 6) : 12
    const xl: gridItemSpanValueShape | undefined = multipleColumns ? (horizontalLabels ? 6 : 6) : 12
    const xl2: gridItemSpanValueShape | undefined = multipleColumns ? (horizontalLabels ? 4 : 4) : 12
    const maxWidth: number | undefined = multipleColumns ? undefined : horizontalLabels ? 960 : 800

    return (
        // <PageBody>
        <FormProvider {...form}>
            <Form
                // eslint-disable-next-line @typescript-eslint/no-misused-promises
                onSubmit={handleSubmit((data) => {
                    setError('')
                    return props.onSubmit(data, setError, setFieldError)
                })}
                isHorizontal={horizontalLabels}
                style={{ display: 'flex', flexDirection: 'column', flexGrow: 1, overflow: 'hidden', gap: 0 }}
            >
                <Scrollable style={{ height: '100%', flexGrow: 1 }}>
                    <PageSection
                        isFilled
                        padding={{ default: props.onCancel ? 'padding' : 'noPadding' }}
                        variant="light"
                        style={{ maxWidth }}
                    >
                        <Grid hasGutter span={12} sm={sm} md={md} lg={lg} xl={xl} xl2={xl2}>
                            {props.schema && <FormSchema schema={props.schema} />}
                            {props.children}
                        </Grid>
                    </PageSection>
                </Scrollable>
                <Collapse open={!!error}>
                    <Alert
                        variant="danger"
                        title={error ?? ''}
                        isInline
                        style={{ paddingLeft: isSm && props.onCancel ? 190 : undefined }}
                    />
                </Collapse>
                {props.onCancel ? (
                    <PageSection isFilled={false} style={{ borderTop: 'thin solid var(--pf-global--BorderColor--100)' }} variant="light">
                        <ActionGroup style={{ marginTop: 0 }}>
                            <PageFormSubmitButton>{props.submitText}</PageFormSubmitButton>
                            {props.onCancel && <PageFormCancelButton onCancel={props.onCancel}>{props.cancelText}</PageFormCancelButton>}
