                    </PageSection>
                ) : (
                    <PageFormSubmitButton style={{ marginTop: 48 }}>{props.submitText}</PageFormSubmitButton>
                )}
            </Form>
        </FormProvider>
        // </PageBody>
    )
}

export type FormPageSubmitHandler<T extends FieldValues> = (
    data: T,
    setError: (error: string) => void,
    setFieldError: (fieldName: FieldPath<T>, error: ErrorOption) => void
) => Promise<unknown>

export function PageFormSubmitButton(props: { children: ReactNode; style?: CSSProperties }) {
    const { isSubmitting, errors } = useFormState()
    const hasErrors = errors && Object.keys(errors).length > 0
    return (
        <Tooltip content="Please fix errors" trigger={hasErrors ? undefined : 'manual'}>
            <Button
                type="submit"
                isDisabled={isSubmitting}
                isLoading={isSubmitting}
                isDanger={hasErrors}
                variant={hasErrors ? 'secondary' : undefined}
                style={props.style}
            >
                {props.children}
            </Button>
        </Tooltip>
    )
}

export function PageFormCancelButton(props: { onCancel: () => void; children: ReactNode }) {
    return (
        <Button type="button" variant="link" onClick={props.onCancel}>
            {props.children}
        </Button>
    )
}

import { Page, PageSection, Title } from '@patternfly/react-core'
import { Static, Type } from '@sinclair/typebox'
import ky from 'ky'
import { useCallback, useMemo } from 'react'
import { useHistory } from 'react-router-dom'
import { useWindowSizeOrLarger, WindowSize } from '../../../framework'
import { useTranslation } from '../../../framework/components/useTranslation'
import { FormPageSubmitHandler, PageForm } from '../../common/FormPage'
import { headers } from '../../Data'
import { RouteE } from '../../route'

export default function Login() {
    const { t } = useTranslation()

    const history = useHistory()

    const DataType = Type.Object({
        server: Type.String({
            title: t('Server'),
            placeholder: t('Enter server'),
            minLength: 1,
            errorMessage: { required: 'Server is required', minLength: 'Server is required' },
        }),
        username: Type.String({
            title: t('Username'),
            placeholder: t('Enter username'),
            minLength: 1,
            errorMessage: { required: 'Username is required', minLength: 'Username is required' },
        }),
        password: Type.String({
            title: t('Password'),
            placeholder: t('Enter password'),
            minLength: 1,
            errorMessage: { required: 'Password is required', minLength: 'Password is required' },
            variant: 'password',
        }),
    })

    type Data = Static<typeof DataType>

    const servers = useMemo<{ server: string; username: string }[]>(() => {
        try {
            const serversString = localStorage.getItem('servers')
            if (typeof serversString === 'string') {
                const servers = JSON.parse(serversString) as { server: string; username: string }[]
                if (Array.isArray(servers)) {
                    if (servers.every((server) => typeof server === 'object')) {
                        return servers.filter((server) => 'server' in server && 'username' in server)
                    }
                }
            }
            return []
        } catch {
            return []
        }
    }, [])

    const onSubmit = useCallback<FormPageSubmitHandler<Data>>(
        async (data, setError) => {
            try {
                let loginPage = await ky.get('/api/login/', { credentials: 'include', headers: { 'x-server': data.server } }).text()
                loginPage = loginPage.substring(loginPage.indexOf('csrfToken: '))
                loginPage = loginPage.substring(loginPage.indexOf('"') + 1)
                const csrfmiddlewaretoken = loginPage.substring(0, loginPage.indexOf('"'))

                const searchParams = new URLSearchParams()
                searchParams.set('csrfmiddlewaretoken', csrfmiddlewaretoken)
                searchParams.set('username', data.username)
                searchParams.set('password', data.password)
                await ky.post('/api/login/', { credentials: 'include', headers: { 'x-server': data.server }, body: searchParams })

                headers['x-server'] = data.server
                localStorage.setItem('server', data.server)
                localStorage.setItem(
                    'servers',
                    JSON.stringify([...new Set([{ server: data.server, username: data.username }, ...servers])])
                )

                history.push(RouteE.Teams)
            } catch (err) {
                if (err instanceof Error) {
                    setError(err.message)
                } else {
                    setError('Invalid username or password. Please try again.')
                }
            }
        },
        [history, servers]
    )

    const sm = useWindowSizeOrLarger(WindowSize.sm)
    const md = useWindowSizeOrLarger(WindowSize.md)

    const padding = md ? 48 : sm ? 32 : 16

    return (
        <Page style={{ backgroundColor: sm ? '#222' : 'white' }}>
            <PageSection
                variant="light"
                padding={{ default: 'noPadding' }}
                style={{
                    width: 500,
                    maxWidth: '100%',
                    marginLeft: 'auto',
                    marginRight: 'auto',
                    marginTop: sm ? 'auto' : undefined,
                    marginBottom: sm ? 'auto' : undefined,
                    padding,
                }}
                isFilled={!sm}
            >
                <Title headingLevel="h2">Welcome to the</Title>
                <Title className="pt-8 pb-24" headingLevel="h1">
                    Ansible Automation Platform
                </Title>
                <PageForm
                    schema={DataType}
                    submitText={t('Submit')}
                    onSubmit={onSubmit}
                    cancelText={t('Cancel')}
                    isVertical
                    defaultValue={servers.length ? { server: servers[0].server, username: servers[0].username } : {}}
                />
            </PageSection>
        </Page>
    )
}

import { Static, Type } from '@sinclair/typebox'
import { HTTPError } from 'ky'
import { useHistory, useParams } from 'react-router-dom'
import useSWR from 'swr'
import { PageBody, PageHeader } from '../../../../framework'
import { useTranslation } from '../../../../framework/components/useTranslation'
import { FormPageSubmitHandler, PageForm } from '../../../common/FormPage'
import { ItemsResponse, requestGet, requestPatch, requestPost } from '../../../Data'
import { RouteE } from '../../../route'
import { Organization } from '../organizations/Organization'
import { Team } from './Team'

export function EditTeam() {
    const { t } = useTranslation()
    const history = useHistory()

    const params = useParams<{ id?: string }>()
    const id = Number(params.id)

    // const project = useProject(id)
    const { data: team } = useSWR<Team>(Number.isInteger(id) ? `/api/v2/teams/${id.toString()}/` : undefined, requestGet)

    const EditTeamSchema = Type.Object({
        name: Type.String({
            title: t('Name'),
            placeholder: t('Enter the name'),
            minLength: 1,
            errorMessage: { minLength: t('Name is required') },
        }),
        description: Type.Optional(
            Type.String({
                title: t('Description'),
                placeholder: t('Enter the description'),
                variant: 'textarea',
            })
        ),
        organization: Type.Optional(Type.Number()),
        summary_fields: Type.Object({
            organization: Type.Object({
                name: Type.String({
                    title: t('Organization'),
                    placeholder: t('Enter the organization'),
                    minLength: 1,
                    errorMessage: { minLength: t('Organization is required') },
                    variant: 'select',
                }),
            }),
        }),
    })

    type CreateTeam = Static<typeof EditTeamSchema>

    // const { cache } = useSWRConfig()

    const onSubmit: FormPageSubmitHandler<CreateTeam> = async (editedTeam, setError, setFieldError) => {
        try {
            if (process.env.DELAY) await new Promise((resolve) => setTimeout(resolve, Number(process.env.DELAY)))
            const result = await requestGet<ItemsResponse<Organization>>(
                `/api/v2/organizations/?name=${editedTeam.summary_fields.organization.name}`
            )
            if (result.results.length === 0) {
                setFieldError('summary_fields.organization.name', { message: t('Organization not found') })
                return false
            }
            const organization = result.results[0]
            editedTeam.organization = organization.id
            let team: Team
            if (Number.isInteger(id)) {
                team = await requestPatch<Team>(`/api/v2/teams/${id}/`, editedTeam)
            } else {
                team = await requestPost<Team>('/api/v2/teams/', editedTeam)
            }
            // ;(cache as unknown as { clear: () => void }).clear()
            history.push(RouteE.TeamDetails.replace(':id', team.id.toString()))
        } catch (err) {
            if (err instanceof HTTPError) {
                try {
                    const response = (await err.response.json()) as { __all__?: string[] }
                    if ('__all__' in response && Array.isArray(response.__all__)) {
                        setError(JSON.stringify(response.__all__[0]))
                    } else {
                        setError(JSON.stringify(response))
                    }
                } catch {
                    setError(err.message)
                }
            } else if (err instanceof Error) {
                setError(err.message)
            } else {
                setError('unknown error')
            }
        }
    }
    const onCancel = () => {
        Number.isInteger(id) ? history.push(RouteE.TeamDetails.replace(':id', id.toString())) : history.push(RouteE.Teams)
    }

    if (Number.isInteger(id)) {
        if (!team) {
            return (
                <>
                    <PageHeader breadcrumbs={[{ label: t('Teams'), to: RouteE.Teams }, { label: t('Edit Team') }]} />
                </>
            )
        } else {
            return (
                <>
                    <PageHeader title={t('Edit Team')} breadcrumbs={[{ label: t('Teams'), to: RouteE.Teams }, { label: t('Edit Team') }]} />
                    <PageBody>
                        <PageForm
                            schema={EditTeamSchema}
                            submitText={t('Save')}
                            onSubmit={onSubmit}
                            cancelText={t('Cancel')}
                            onCancel={onCancel}
                            defaultValue={team}
                        />
                    </PageBody>
                </>
            )
        }
    } else {
        return (
            <>
                <PageHeader title={t('Create Team')} breadcrumbs={[{ label: t('Teams'), to: RouteE.Teams }, { label: t('Create Team') }]} />
                <PageBody>
                    <PageForm
                        schema={EditTeamSchema}
                        submitText={t('Create')}
                        onSubmit={onSubmit}
                        cancelText={t('Cancel')}
                        onCancel={onCancel}
                    />
                </PageBody>
            </>
        )
    }
}

import { Divider, Flex, FlexItem, PageSection, PageSectionTypes, Skeleton, Tab, Tabs } from '@patternfly/react-core'
import { Children, Dispatch, Fragment, isValidElement, ReactNode, SetStateAction, useCallback, useState } from 'react'

export function PageTabs(props: { children: ReactNode; preComponents?: ReactNode; postComponents?: ReactNode }) {
    const [activeKey, setActiveKey] = useState<number>(0)
    const onSelect = useCallback((_, key: string | number) => setActiveKey(key as number), [setActiveKey])
    const children = Children.toArray(props.children)
    const tabs = children.map((child, index) => {
        if (isValidElement(child)) {
            if (child.type === PageTab) {
                const title = child.props.title
                return <Tab title={title ? title : <Skeleton width="60px" />} eventKey={index} />
            }
        }
        return child
    })
    const content = children[activeKey]
    return (
        <Fragment>
            <PageSection type={PageSectionTypes.tabs}>
                <Flex spaceItems={{ default: 'spaceItemsNone' }}>
                    {props.preComponents && (
                        <Fragment>
                            <FlexItem
                            // style={{ paddingLeft: 16 }}
                            >
                                {props.preComponents}
                            </FlexItem>
                            <Divider orientation={{ default: 'vertical' }} component="div" />
                        </Fragment>
                    )}
                    <FlexItem grow={{ default: 'grow' }}>
                        <Tabs
                            activeKey={activeKey}
                            onSelect={onSelect}
                            inset={
                                props.preComponents
                                    ? undefined
                                    : {
                                          default: 'insetNone',
                                          sm: 'insetNone',
                                          md: 'insetNone',
                                          lg: 'insetNone',
                                          xl: 'insetSm',
                                          ['2xl']: 'insetSm',
                                      }
                            }
                            hasBorderBottom={false}
                        >
                            {tabs}
                        </Tabs>
                    </FlexItem>
                    {props.postComponents && (
                        <Fragment>
                            <Divider orientation={{ default: 'vertical' }} />
                            <FlexItem style={{ paddingRight: 16 }}>{props.postComponents}</FlexItem>
                        </Fragment>
                    )}
                </Flex>
            </PageSection>
            <Divider />
            {content}
        </Fragment>
    )
}

export function PageTab(props: { title?: string; children: ReactNode }) {
    return <Fragment>{props.children}</Fragment>
}

export function PageTabsOld(props: {
    activeKey: string | number
    setActiveKey: Dispatch<SetStateAction<string | number>>
    children: ReactNode
}) {
    const { activeKey, setActiveKey } = props
